import './App.css';
import Headers from './components/header/Headers';
import Footer from './components/footer/footer';
import Login from './pages/Login';
import { BrowserRouter, Route } from 'react-router-dom';

function App() {
  return (
    <>
      <BrowserRouter>
        <Route exact path="/login">
              <Login />
          </Route>
      </BrowserRouter>

      <Headers />
    </>
  );
}

export default App;
